
<html>
<head>
  <title>Neurofumo !</title>
  <style>
    body {
        zoom:0.4;
      display: flex;
      justify-content: center;
      align-items: center;
      overflow: hidden;
    }
    table {
            border-collapse: collapse;
        }
      td{
        width: 2px;
        height: 4px;
        transition: background-color 0.3s;
      }

            td.hovered {
      animation: color-cycle 5s infinite linear;
      
    }

    @keyframes color-cycle {
      0% { background-color: hsl(0, 100%, 50%); }
      25% { background-color: hsl(90, 100%, 50%); }
      50% { background-color: hsl(180, 100%, 50%); }
      75% { background-color: hsl(270, 100%, 50%); }
      100% { background-color: hsl(0, 100%, 50%); }
    }
        
  </style>
   <script>
    // JavaScript to toggle the 'hovered' class on hover
    document.addEventListener('DOMContentLoaded', function() {
      var tds = document.getElementsByTagName('td');
      for (var i = 0; i < tds.length; i++) {
        tds[i].addEventListener('mouseover', function() {
          this.classList.add('hovered');
        });
        tds[i].addEventListener('mouseout', function() {
          this.classList.remove('hovered');
        });
      }
    });
  </script>
 <script>
    // JavaScript to toggle the 'hovered' class on click and apply to cells within a gradually increasing circular radius
    document.addEventListener('DOMContentLoaded', function() {
      var tds = document.getElementsByTagName('td');

      function assignHoveredClass(target, radius) {
        var currentIndex = Array.prototype.indexOf.call(tds, target);
        var currentRow = Math.floor(currentIndex / 128); // Assuming 128 cells per row

        for (var i = 0; i < tds.length; i++) {
          var rowIndex = Math.floor(i / 128);
          var colIndex = i % 128;
          var distance = Math.sqrt(Math.pow(rowIndex - currentRow, 2) + Math.pow(colIndex - (currentIndex % 128), 2));

          if (distance <= radius) {
            tds[i].classList.add('hovered');
            setTimeout(function() {
            tds[i].classList.remove('hovered');
          }, 500);
            //console.log("if")
          } else {
            //tds[i].classList.remove('hovered');
          
            //console.log("else")
          }
        }
      }

      function handleClick(target) {
        var maxRadius = Math.floor(Math.random() * 20) + 1; // Maximum radius for the hovered cells
        var currentRadius = 1;
        var interval = setInterval(function() {
          assignHoveredClass(target, currentRadius);
          currentRadius++;
          if (currentRadius > maxRadius) {
            clearInterval(interval);
          }
        }, 200); // Delay in milliseconds between radius increment

        setTimeout(function() {
          assignHoveredClass(target, maxRadius);
        }, (maxRadius + 1) * 200); // Delay for the final radius
      }

      for (var i = 0; i < tds.length; i++) {
        tds[i].addEventListener('click', function() {
          var self = this;
          setTimeout(function() {
            handleClick(self);
          }, 0); // Delay in milliseconds to allow time for the 'hovered' class removal in case of rapid clicks
        });
      }
    });
  </script>
